import React from 'react';

function Services() {
  return (
    <section className="services bg-dark text-white py-5">
      <div className="container text-center">
        <h2>Our Services</h2>
        <p>We offer a variety of services to keep your car in top condition.</p>
      </div>
    </section>
  );
}

export default Services;
